func (bq *BusinessQuery) querySpec() *sqlgraph.QuerySpec {
	_spec := sqlgraph.NewQuerySpec(business.Table, business.Columns, sqlgraph.NewFieldSpec(business.FieldID, field.TypeUint64))
	_spec.From = bq.sql
	if unique := bq.ctx.Unique; unique != nil {
		_spec.Unique = *unique
	} else if bq.path != nil {
		_spec.Unique = true
	}
	if fields := bq.ctx.Fields; len(fields) > 0 {
		_spec.Node.Columns = make([]string, 0, len(fields))
		_spec.Node.Columns = append(_spec.Node.Columns, business.FieldID)
		for i := range fields {
			if fields[i] != business.FieldID {
				_spec.Node.Columns = append(_spec.Node.Columns, fields[i])
			}
		}
		if bq.withRider != nil {
			_spec.Node.AddColumnOnce(business.FieldRiderID)
		}
		if bq.withCity != nil {
			_spec.Node.AddColumnOnce(business.FieldCityID)
		}
		if bq.withSubscribe != nil {
			_spec.Node.AddColumnOnce(business.FieldSubscribeID)
		}
		if bq.withEmployee != nil {
			_spec.Node.AddColumnOnce(business.FieldEmployeeID)
		}
		if bq.withStore != nil {
			_spec.Node.AddColumnOnce(business.FieldStoreID)
		}
		if bq.withPlan != nil {
			_spec.Node.AddColumnOnce(business.FieldPlanID)
		}
		if bq.withEnterprise != nil {
			_spec.Node.AddColumnOnce(business.FieldEnterpriseID)
		}
		if bq.withStation != nil {
			_spec.Node.AddColumnOnce(business.FieldStationID)
		}
		if bq.withCabinet != nil {
			_spec.Node.AddColumnOnce(business.FieldCabinetID)
		}
		if bq.withBattery != nil {
			_spec.Node.AddColumnOnce(business.FieldBatteryID)
		}
		if bq.withAgent != nil {
			_spec.Node.AddColumnOnce(business.FieldAgentID)
		}
		if bq.withRtoEbike != nil {
			_spec.Node.AddColumnOnce(business.FieldRtoEbikeID)
		}
	}
	if ps := bq.predicates; len(ps) > 0 {
		_spec.Predicate = func(selector *sql.Selector) {
			for i := range ps {
				ps[i](selector)
			}
		}
	}
	if limit := bq.ctx.Limit; limit != nil {
		_spec.Limit = *limit
	}
	if offset := bq.ctx.Offset; offset != nil {
		_spec.Offset = *offset
	}
	if ps := bq.order; len(ps) > 0 {
		_spec.Order = func(selector *sql.Selector) {
			for i := range ps {
				ps[i](selector)
			}
		}
	}
	return _spec
}

func (bq *BusinessQuery) sqlQuery(ctx context.Context) *sql.Selector {
	builder := sql.Dialect(bq.driver.Dialect())
	t1 := builder.Table(business.Table)
	columns := bq.ctx.Fields
	if len(columns) == 0 {
		columns = business.Columns
	}
	selector := builder.Select(t1.Columns(columns...)...).From(t1)
	if bq.sql != nil {
		selector = bq.sql
		selector.Select(selector.Columns(columns...)...)
	}
	if bq.ctx.Unique != nil && *bq.ctx.Unique {
		selector.Distinct()
	}
	for _, m := range bq.modifiers {
		m(selector)
	}
	for _, p := range bq.predicates {
		p(selector)
	}
	for _, p := range bq.order {
		p(selector)
	}
	if offset := bq.ctx.Offset; offset != nil {
		// limit is mandatory for offset clause. We start
		// with default value, and override it below if needed.
		selector.Offset(*offset).Limit(math.MaxInt32)
	}
	if limit := bq.ctx.Limit; limit != nil {
		selector.Limit(*limit)
	}
	return selector
}

